Laidose moteris jau spėjo pakalbinti gerai žinomus šalies žmones ir suburti savo gerbėjų bei žiūrovų ratą. Tiesa, kai kurie žiūrovai pažėrė ir kritikos ar net kaltinimų kopijavimu. Su DELFI susisiekusi skaitytoja teigė, kad viena laidos rubrikų yra „ Vogue  73 Questions“ kopija. Kaip anksčiau laidos kūrėjai skelbė pranešime spaudai, vienoje laidos „Kitu kampu“ rubrikų garsiam žmogui siūloma avantiūra – atsakyti į 50 netikėtų klausimų, kurie rūpi jo fanams. Veiksmas vyksta garsaus žmogaus aplinkoje: besiruošiant į darbą, vykstant į koncertą, atostogaujant pajūryje. Tokiu pat principu jau kelerius metus filmuojami ir garsieji „Vogue“ interviu su garsenybėmis. Jų aplinkoje rengiami interviu trunka trumpai, greitai atsakoma į 73 klausimus. Laidos „Kitu kampu“ interviu nuo 17:25 min. galima pažiūrėti  ČIA . „Vogue 73 Questions“ interviu: (function(d, s, i, r) {
